- input: "TEXT\x1CC00009985\x1C9A4D1C66-6A2D-4C16-B\x1C\x1CF3XA\x1CThis amendment
    is being submitted in response to your Request for Additional Information (RFAI)
    dated September 29, 2010.  You have requested information regarding $7,400 in
    earmarked contributions disclosed on Schedule B of the September monthly report
    (8/1/10-8/31/10).  This amendment clarifies that Judy Duhamel's $500 receipt on
    Schedule A was in fact an earmarked contribution and corresponds to the $500 contribution
    earmarked for Stephanie Herseth Sandlin for South Dakota on Schedule B.  In addition,
    the amendment shows on Schedule A that $2,400 of William Duhamel's $2,500 contribution
    dated August 18, 2010 was earmarked for the $2,400 earmarked disbursement to Stephanie
    Herseth Sandlin for South Dakota disclosed on Schedule B.  Finally, Schedule A
    was updated to show that $500 of Randy Gravley's $500 contribution was earmarked
    for the corresponding disbursement on Schedule B to Westmoreland for Congress.
    \ Schedule B is being amended to show that three disbursements that were previously
    disclosed as earmarked contributions were in fact intended to be from NABPAC rather
    than earmarked from Randy Gravely.  These disbursements include Gingrey for Congress
    ($1,000 on August 12, 2010), Price for Congress ($1,000 on August 12, 2010) and
    Graves for Congress ($2,000 on August 12, 2010).  Further we have revised our
    policies and procedures regarding earmarked contributions to ensure that earmarked
    contributions are reported correctly in the future and there is no confusion about
    which disbursements are intended to be from the PAC and those that are earmarked
    by individuals.\n"
